  return (
    <>
    <Player></Player>
      <Spring from={{ opacity: 0 }} to={{ opacity: 1 }} config={{duration: 4000}} tra>
        {(props) => (
          <Section style={props}></Section>
        )}
      </Spring>
    </>
  );
}

